import React, { useEffect } from "react";
import { useDispatch, useSelector } from 'react-redux';
import { fetchPosts } from "../redux/actions/postActions";
import axios from "axios";

const Main = () => {
    const posts = axios.get('http://localhost:8000/api/main')

    return (
        <React.Fragment>
            <div className="post_list">
                {posts.map(post => (
                    <div key={post.id}>
                        <h3>{post.title}</h3>
                        <p>{post.content}</p>
                    </div>
                ))}
            </div>
        </React.Fragment>
    )

}

export default Main;
